import { createBrowserRouter } from "react-router-dom";
import HomePage from "./pages/Home";

// El PATH es lo que va despues del dominio.
// Si tengo una pagina: https://example.com/products
// https es el protocolo, example.com el dominio, /products seria el path.

createBrowserRouter([
  { path: "/", element: <HomePage /> },
  { path: "" },
  { path: "" },
]);

function App() {
  return <div></div>;
}

export default App;
